  input: "\"TEXT\",\"F3XA\",\"C00143743\",\"May 25, 2006  Mr. Brad Decker, Federal
    Election Commission, Washington, DC 20463    RE:\t\t\t\tRepublican Party of Texas
    \ Identification Number:\tC00143743  Report:\t\t\t\tMarch Monthly Report (02-1-06
    to 02-28-06)    Filed\t\t\t\tMay 20, 2006    Dear Mr. Decker:  Pursuant to your
    letter dated, April 26, 2006, regarding the March Monthly Report, we have corrected
    the memo entry contribution amount of $4,707. 38 on Schedule A Line 11(a)(i) to
    reflect the current month travel reimbursements.  This amount ties to the amount
    of $4,707.38 previously reported on Schedule D.  The difference between the $6,965.80
    and $4,707.38 is $2,258.42.  An entry in the amount of $2,258.42 was inadvertently
    entered into the software with an incorrect date of 01/31/05 instead of 01/31/06
    and as a result, did not appear as is was intended as a contribution on the February
    Monthly report.  The February Monthly report has been amended to reflect this
    change.  Upon further review of the March Monthly report, the following items,
    which were inadvertently left off the originally filed report; were identified
    and have been corrected, a contribution in the amount of $75.00, interest income
    in the amount of $54.24 and an increase in a credit card change in the amount
    of $10, resulting in an increase of $119.24 in the cash on hand at the end of
    the report.  Best regards, Christopher Maska, Treasurer, The Republican Party
    of Texas\""
